import './Fashion.css';

import { Col, Container, Row } from "react-bootstrap";

import Fashion1 from '../Image/fashion1.jpeg';
import Fashion2 from '../Image/fashion2.jpeg';
import Fashion3 from '../Image/fashion3.jpeg';
import Fashion4 from '../Image/fashion4.jpeg';

function Fashion(){

    const ArraysOfFashion = [{
        id: 1,
        image: Fashion1,
        uptitle: 'Lorem',
        title: 'I always loved aesthetics'
    },
    {
        id: 2,
        image: Fashion2,
        uptitle: 'Lorem',
        title: 'Change is always happening'
    },
    {
        id: 3,
        image: Fashion3,
        uptitle: 'Lorem',
        title: 'I want to be different, and fashion gives me that outlet to do that'
    },
    {
        id: 4,
        image: Fashion4,
        uptitle: 'Lorem',
        title: 'Fashion is not about clothes, it is about a look'
    }];
    const ArraysOfFashionOnMap = ArraysOfFashion.map((ArrayOfFashion) => 
    <Col key = {ArrayOfFashion.id} lg = "3" md = "6" sm = "12">
        <div className = "fashion-element">
            <img src = {ArrayOfFashion.image} className = "w-100 fashion-image"/>
            
            <div className = "fashion-content">
                <h6 className = "fashion-uptitle">{ArrayOfFashion.uptitle}</h6>
                <h2 className = "fashion-title">{ArrayOfFashion.title}</h2>
            </div>
        </div>
    </Col>
    )

    return(
        <Container fluid>
            <div className = "fashion-wrapper">
                <div className = "fashion-header">
                    <h1>Fashion</h1>
                    <h5>See all Fashion</h5>
                </div>

                <div className = "fashion-inner">
                    <Row className = "g-2">
                        {ArraysOfFashionOnMap}
                    </Row>
                </div>
            </div>
        </Container>
    )
}

export default Fashion
